import "./Create.css";

const Create = () => {
  const onSubmit = e => {
    e.preventDefault();

    fetch ("")
  }

  return (
    <div className="create">
      <h1>Write a new blog</h1>
      <form onSubmit={onSubmit}>
        <p class="author">
          <label htmlFor="#author">Author</label>
          <br />
          <input
            type="text"
            name="author"
            id="author"
            placeholder="your name"
          />
        </p>
        <p class="title">
          <label htmlFor="#title">Blog title</label>
          <br />
          <input type="text" name="title" id="title" placeholder="awesome" />
        </p>
        <p class="body">
          <label htmlFor="#body">What inspires you today?</label>
          <br />
          <textarea name="body" id="body" cols="50" rows="10"></textarea>
        </p>
        <p class="submit"><button type="submit">Create</button></p>
      </form>
    </div>
  );
};

export default Create;
